import React from 'react';
import './Hero.css';

const Hero = () => {
    return (
        <header className="hero" id="hero">
            <h1>Bienvenido a la página del satélite PACE</h1>
            <p>Explora los datos del océano y la atmósfera de la Tierra.</p>
        </header>
    );
}

export default Hero;
